import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

console.log('you reached hero')
export const HeroSection = (props) => {
  return (
    <div className='hero-container'>
     <video src='/videos/video-2.mp4' autoPlay loop muted />
      <h1>MANGOPULSE</h1>
      <p>content management system</p>
      <div className='hero-btns'>
        <Button
          
          className='btns'
          buttonStyle='btn--outline'
          buttonSize='btn--large'
        >
         ADMIN ARERA
        </Button>
        <Button
         
          className='btns'
          buttonStyle='btn--primary'
          buttonSize='btn--large'
          onClick={console.log('hey')}
          
        >
          FRONT AREA <i className='far fa-play-circle' />
          
        </Button>
        <a><span className="tagline" id="x" href={props.page.linkAdmin} >{props.page.admin}</span></a>
        <a><span className="tagline" id="y" href={props.page.linkFront}>{props.page.front}</span></a>
      </div>
    </div>
  );
}
